import React from 'react';
import './About.css';
import Data from '../data.png';
import Ny from '../ny.png';
function About() {
  return (
    <div className='About'>
      <div className='about__container'>
        <div className='about__details'></div>
        <img src={Data} alt='data' />
        <img src={Ny} alt='New York' />
      </div>
    </div>
  );
}

export default About;
